import React from "react";
import StoresTable from "../components/StoresTable";

function StoresPage({ stores }) {
  return (
    <>
      <h1>This is Store Page</h1>
      <p>Tell the user what to do</p>
      {stores.map(store => (
        <StoresTable
          id={store.id}
          city={store.city}
          state={store.state}
          zipCode={store.zipCode}
        />
      ))}
    </>
  );
}

export default StoresPage;
